import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function Question({verify}) {
  return (   
    <>
      <Card.Body style={{color:'white', textAlign:'center', marginTop:'10px'}}>¿Tu personaje es ficticio?</Card.Body><br></br>
      <Button onClick={verify()} variant="outline-warning">✓</Button>

    </>
  );
}

export default Question;
